import React from "react";
import { Col, Row } from "reactstrap";

class Savecards extends React.Component{
    render(){
        return(
            <Col lg="4" md="6" sm="9" xs="10">
                <div className="card-wrap">
                    <div className="cover">
                        <ul>
                            <li><i class="fas fa-edit"></i></li>
                            <li><i class="fas fa-share-alt"></i></li>
                            <li><i class="fas fa-trash"></i></li>
                        </ul>
                    </div>
                    <Row className="inner-layer">
                        <Col lg="5" md="5" sm="5" xs="5" style={{minHeight:"inherit"}}>
                            <div className="fileimage">
                                <i class="fa fa-file" aria-hidden="true"></i>
                            </div>
                        </Col>
                        <Col lg="7" md="7" sm="7" xs="7">
                            <p>hellow</p>
                        </Col>
                    </Row>

                </div>
            </Col>

        );

    }

}
export default Savecards;
